// src/main.js

import Vue from 'vue';
import App from './App.vue';
import axios from './plugins/axios';

// Ensure that Vue is fully initialized before setting up the Axios plugin
new Vue({
    render: h => h(App),
    created() {
        // Set up Axios plugin after Vue is created
        Vue.prototype.$axios = axios;
    },
}).$mount('#app');
